import React from 'react';

import styles from './Person.module.css';

const person = (props) => {
    return (
        <div className={styles.Person}>
            <p>{props.id}</p>
            <p>{props.name}</p>
            <p>{props.number}</p>
        </div>
    );
}

export default person;
